import React from 'react';
import { Route, Routes } from 'react-router-dom';
import './App.css';
import Myweek from './Myweek';
import Detail from './Detail';

function App() {

    const [day, setDay] = React.useState(['월', '화', '수', '목', '금', '토', '일']);

    return (
        <div className="App">
            <div style={{
                width: "550px",
                height: "800px",
                border: "1px solid lightgrey",
                margin: "80px auto",
            }} >
                <div style={{
                    width: "400px",
                    margin: "100px auto",
                }}>
                    <h3>내 일주일은?</h3>
                    <Routes>
                        <Route path="/" element={<Myweek day={day} />}>
                        </Route>
                        <Route path="/detail" element={<Detail />}>
                        </Route>
                    </Routes>
                </div>
            </div>
        </div>
    );
}

export default App;
